import { useSelector } from "react-redux";
import Card from "./Card";

const Favorites = () => {
    const favorites = useSelector((state) => state.myFavorites);

    return (
        <>
        {favorites.map(({id, name, species, gender, image, onClose}) => {
            return (
                <Card
                key={id}
                id={id}
                name ={name}
                species={species}
                gender={gender}
                image={image}
                onClose={onClose} />
            );
        })}
        </>
    );
};



export default Favorites;
